import React from "react";
import "./style.css";

const SignUpPage = () => {
  const handleSignUp = () => {
    // Handle sign up logic
  };

  return (
    <div className="container">
      <h4 className="font2">
        <b>SIGN UP</b>
        <img
          src={require(`../img/lookkai.pngs`)}
          alt="Lookkai"
          width="100"
          height="100"
          className="right"
        />
      </h4>
      <h5 className="font">
        <b>Already a member?</b>&nbsp;
        <a href="U1_SignIn.html">Sign in</a>
      </h5>
      <br />
      <br />
      <h4 className="email">
        <b>Email</b>
      </h4>
      <div className="input-box">
        <input type="text" placeholder="ex.xyz@gmail.com" />
        <br />
        <h4 className="email">
          <b>Password</b>
        </h4>
        <input type="password" id="password" placeholder="Password" />
      </div>
      <br />
      <input
        type="submit"
        onClick={handleSignUp}
        value="Sign up"
        className="button-signUp"
      />
    </div>
  );
};

export default SignUpPage;
